So far, Alan hasn't paid too much attention to Context and Poll. It's been fine to simply pass them along untouched. There's a confusing bug in his state machine. Let's look more closely: // zooming in!
match ready!(Pin::new(file).poll_next(cx)) { Some(result) => { let chunk = result?; sig.push(&chunk); return Poll::Ready(Some(Ok(val)); }, None => { self.set_state_to_signing(); // oops! return Poll::Pending; }
} In one of the branches, the state is changed, and Poll::Pending is returned. Alan assumes that the task will be polled again with the new state. But, since the file was done (and has returned Poll::Ready), there was actually no waker registered to wake the task again. So his stream just hangs forever. The compiler doesn't help at all, and he re-reads his code multiple times, but because of this easy-to-misunderstand logic error, Alan eventually has to ask for help in a chat room. After a half hour of explaining all sorts of details, a kind person points out he either needs to register a waker, or perhaps use a loop. All too often, since we don't want to duplicate code in multiple branches, the solution for Alan is to add an odd loop around the whole thing, so that the next match branch uses the Context: loop { match self.state { State::File(ref mut file, ref mut sig) => { match ready!(Pin::new(file).poll_next(cx)) { Some(result) => { let chunk = result?; sig.push(&chunk); return Poll::Ready(Some(Ok(chunk))) }, None => { let sig = match std::mem::replace(&mut self.state, State::Done) { State::File(_, sig) => sig, _ => unreachable!(), }; self.state = State::Signing(Box::pin(sig.digest())); // loop again, to catch the `State::Signing` branch } } }, State::Signing(ref mut sig) => { let last_chunk = ready!(sig.as_mut().poll(cx)); self.state = State::Done; return Poll::Ready(Some(Ok(last_chunk))) } State::Done => return Poll::Ready(None), }
}

