Alan now starts with his first async project. He sees that there is no async in the standard library, but after googling for "rust async file open", he finds 'async_std', a crate that provides some async versions of the standard library functions. He has some code written that asynchrously interacts with some files: use async_std::fs::File;
use async_std::prelude::*; fn main() -> Result<(), Box<dyn std::error::Error>> { let mut file = File::create("a.txt").await?; file.write_all(b"Hello, world!").await?; Ok(())
} But now the compiler complains that await is only allowed in async functions. He now notices that all the examples use #[async_std::main] as an attribute on the main function in order to be able to turn it into an async main, so he does the same to get his code compiling: use async_std::fs::File;
use async_std::prelude::*; #[async_std::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> { let mut file = File::create("a.txt").await?; file.write_all(b"Hello, world!").await?; Ok(())
} This aligns with what he knows from C#, where you also change the entry point of the program to be async, in order to use await. Everything is great now, the compiler is happy, so no runtime problems, so Alan is happy. The project is working like a charm.

